import { uploadFileToIPFS } from "./test";

const base64Data = "data:image/jpeg;base64,";

const fileContent = Buffer.from(base64Data, "base64");

export const main = async () => {
  uploadFileToIPFS("filename.jpg", fileContent)
    .then((result) => {
      console.log("File uploaded to IPFS:", result);
      console.log("IPFS URL:", `https://flk-ipfs.xyz/ipfs/${result.cid}`);
    })
    .catch((error) => {
      console.error("Error uploading file to IPFS:", error);
    })
    .finally(() => {
      process.exit();
    });
};

main()

